import React from "react";

function Home({ isLoaded }) {
    return (
        <div className="display-container">
            <h1>Welcome to inFormation!</h1>
            <h2>This is an app to help people stay in contact with one another. By creating or joining formations, you'll be able to keep track of whatever information your contacts want to share with you. Likewise, you have control over what information you share with others.</h2>
        </div>
    );
};

export default Home;
